Wake turbulence: Turbulent air behind an aircraft caused by any of the following:  (a) wing-tip vortices;
(b) rotor-tip vortices;
(c) jet-engine thrust stream or jet blast;
(d) rotor downwash;
(e) prop wash.

Wing tip vortex: A circular pattern of air current created by the movement of an airfoil through the air when the airfoil is generating lift. As an airfoil moves through the
atmosphere in sustained flight, an area of high pressure is created beneath it and an area of low pressure is created above it. The air flowing from the high-pressure area to the low-pressure area around and about the tips of the airfoil tends to roll up into two rapidly rotating vortices, cylindrical in shape. These vortices are the predominant parts of aircraft wake turbulence and their rotational force is dependent upon the wing loading, gross weight, and speed of the generating aircraft. The vortices from medium to heavy aircraft can be of extremely high velocity and hazardous to smaller aircraft.
